import './../styles/header.css';

const Header = () => {
  return (
    <div id='header'>
      <h1>Hi, I'm Jin!</h1>
      <h3>
        <span>I'm a product designer currently studying at</span>
        <span style='color: red'>Cornell University 🐻</span>
      </h3>
    </div>
  );
};

export default Header;
